import ExpenseItem from './ExpenseItem'
import Card from '../UI/Card'
import './Expenses.css';
import {useState} from "react"
import ExpenseFilter from './ExpenseFilter';

const Expenses=(props)=>{
    const ExpenseFilterHandler=(filterVal)=>{
        console.log(filterVal)
          }
   
          const onSelected=(selectedVal)=>{
              console.log(selectedVal);
          }
         
    return (
        <div>
            

       
    
    <Card className="expenses">
    <ExpenseFilter selected={onSelected} onExpenseFilter={ExpenseFilterHandler}></ExpenseFilter>
      
       <ExpenseItem desc={props.items[0].desc} price={props.items[0].price} date={props.items[0].date}></ExpenseItem>
       <ExpenseItem desc={props.items[1].desc} price={props.items[1].price} date={props.items[1].date}></ExpenseItem>
       <ExpenseItem desc={props.items[2].desc} price={props.items[2].price} date={props.items[2].date}></ExpenseItem>
    </Card>
    
    </div>);
}
export default Expenses;
